import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import {Jumbotron, Grid, Row, Col, Image, Button } from 'react-bootstrap';
import './Home.css';
import Navbar from './Gage';
export default class Home extends Component{

    render(){
        return(
            <Grid>
                <Jumbotron>

                    <h2>Welcome to my page</h2>
                    <p>This is how to build a webiste with react, react router, and react bootsrap</p>
                    <Link to="/about">
                    <Button bsStyle="primary">about</Button>
                    </Link>
                </Jumbotron>
                <Row className="show-grid text-center">
                <Col xs={12} sm={4} className="person-wrapper">
                    <Image src="assets/person-1.jpg" circle className="profile-pic"/>
                    <p>Imagination is the key to painting. Don't fiddle with it all day. In nature, dead trees are just as normal as live trees.</p>
                </Col>
                <Col xs={12} sm={4} className="person-wrapper">
                    <Image src="assets/person-2.jpg" circle className="profile-pic"/>
                    <p>Imagination is the key to painting. Don't fiddle with it all day. In nature, dead trees are just as normal as live trees.</p>
                </Col>
                <Col xs={12} sm={4} className="person-wrapper">
                    <Bar />
                    <Image src="assets/person-3.jpg" circle className="profile-pic"/>
                    <p>Imagination is the key to painting. Don't fiddle with it all day. In nature, dead trees are just as normal as live trees.</p>
                </Col>
                </Row>


            </Grid>
        )
    }
}
